query CollectionSearchQuery($first: Int!, $after: String, $sort: StoreSort, $selectedFacets: [StoreSelectedFacet!]!) {
  search(
    first: $first
    after: $after
    sort: $sort
    selectedFacets: $selectedFacets
  ) {
    products {
      pageInfo {
        totalCount
      }
      edges {
        node {
          id: productID
          slug
          sku
          name
          image {
            url
            alternateName
          }
          isVariantOf {
            name
          }
          offers {
            lowPrice
            offers {
              price
              listPrice
              seller {
                identifier
              }
            }
          }
        }
      }
    }
    facets {
      key
      label
      type
      values {
        label
        value
        selected
        quantity
      }
    }
  }
}

